import styled from "styled-components";

const NavOuter = styled.div`
    display: block;
    width: 100%;
`;

const NavWrapper = styled.ul`
    display: grid;
    grid-template-columns: 20% 50% 30%;
`;

const NavItem = styled.li`
    display: grid;
    grid-template-columns: 20% 50% 30%;
`;

export { NavOuter, NavWrapper };
